Karena yang lain pada upload semua, ikut - ikutan deh üòÇ
KAMA 2017... Suatu kepanitian yang lain daripada kepanitiaan lain yang pernah aku ikutin, dan juga salah satu kepanitian yang terberat üò¥ (istirahat + tidur = max 4 jam. Kerja, angkat2 barang, mondar mandir = 20 jam üòì) Bermula dari niatan untuk refreshing dikala kepenatan akan divisi pubdekdok yang aku ikuti di beberapa kepanitian. Pertama kali ditawarin sama sang koor mesti mikir dua kali. Pertama sempet nolak tapi ketimbang bosen jadi pubdekdok terus, perkap sekali sekali oke lah üòÇ (pengakuan dosa) tetapi setelah menjalani keseharian di kepanitiaan ini menjadi salah satu tempat untuk melayani Tuhan üòá. Ini nih comment untuk teman2 seperjuangan ku üòÇ :

@lisanthoni = salah satu temen terbaik ku di jurusan yg sungguh amat sangat luar biasa cerewetnyaa üòÇ. Tapi keren kerjanya semoga jadi koor taun depan üòá

@daniel_teofilus = salah satu temen sejurusan dan se ktb üòÇ di divisi lumayan diem tapi kalo di panitia banyak tingkah nyaa üòÇ. @timothydavin = anggota perkap yang paling diem dan yang paling nurut dan gak banyak komen üëç tapi kerjamu bagus kawan üòâ

@kekemanibuy = koor ku yang biasa dianggap papa tapi "BELUM" punya mama üòÇ (tapi sebentar lagi kita punya mama, percayalah üòÇ) yang PDKT nya garis keras. Kalo jadian sama Ce C..... undang2 yaa ko. (dulu dia frontline ku lho üòÇ) @kevinhermawan97 = anak perkap yang paling strong dari kita semuaa üòÇ ngangkat sendiri sound yang beratnya puluhan kilo üòÇ (anak perkap sejati). Intinyaa... KAMA salah satu kepanitiaan yang berat, tapi tertutupi rasa kebersamaan dan persaudaraan üòá semoga cepet dapet merpati kalian masing2 üòÇüëç Good Job Guys. Maafkan saya yang kurang penting cuma ngelist barang, dan listnya gaa kepake üòÇ
